var image;
var has_image = false;

function halftoneQR(imageCanvas) {
  const pixelSize = parseFloat($("#quality").val());
  const blockSize = parseFloat($("#block-size").val()) * pixelSize;

  var text = $("#input").val();
  var errorLevel = $("#error_level").val();
  var userSize = $("#size").val();

  var QRsize = userSize;

  var qr = qrcode2(QRsize, errorLevel);
  qr.addData(text);
  qr.make();
  const QRBytes = qr.returnByteArray();

  const background = $("#background").val();
  const outputCanvas = $("#output").get(0);
  outputCanvas.width = outputCanvas.height = QRBytes.length * blockSize;


  var outputCtx = outputCanvas.getContext("2d");

  background == "noise" && drawRandomBytes(outputCanvas, QRBytes);
  background == "large" && drawRandomBytes(outputCanvas, QRBytes, true);
  
  
  var tempCanvas = document.createElement("canvas");
  var tempCtx = tempCanvas.getContext("2d");

  tempCanvas.width = outputCanvas.width;
  tempCanvas.height = outputCanvas.height;
  tempCtx.drawImage(imageCanvas, 0, 0, tempCanvas.width, tempCanvas.height);

  const shouldPixelate = $("#pixelate").is(":checked");
  const shouldContrast = $("#blacknwhite").is(":checked");
  const shouldGreyscale = $("#should-greyscale").is(":checked");
  const shouldDither = $("#should-dither").is(":checked");
  shouldPixelate && pixelate(tempCanvas);
  shouldDither && dither(tempCanvas);
  shouldContrast && constrast(tempCanvas);
  shouldGreyscale && greyscale(tempCanvas);

  outputCtx.drawImage(tempCanvas, 0, 0, outputCanvas.width, outputCanvas.height);
  
  var controls = qrcode2(QRsize, errorLevel);
  controls.addData(text);
  controls.make(true);

  drawTransparent(outputCanvas, QRBytes, controls.returnByteArray(), blockSize, pixelSize)

  $("#download").attr("href", outputCanvas.toDataURL());
}

function drawTransparent(canvas, QRBytes, controlBytes, blockSize, pixelSize) {
  
  var ctx = canvas.getContext("2d");

  drawQrContent()
  drawQrControl()

  function drawQrContent() {
    for (var byteRow = 0; byteRow < QRBytes.length; byteRow++) {
      for (var byteCell = 0; byteCell < QRBytes[byteRow].length; byteCell++) {
        // Middle Cell
        ctx.fillStyle = QRBytes[byteRow][byteCell] ? "black" : "white";
        ctx.fillRect(
          byteRow * blockSize + pixelSize,
          byteCell * blockSize + pixelSize,
          pixelSize,
          pixelSize
        );
      }
    }
  }

  function drawQrControl() {
    for (var byteRow = 0; byteRow < controlBytes.length; byteRow++) {
      for (
        var byteCell = 0;
        byteCell < controlBytes[byteRow].length;
        byteCell++
      ) {
        if (controlBytes[byteRow][byteCell] !== null) {
          if (controlBytes[byteRow][byteCell] === true) {
            ctx.fillStyle = "black";
          } else {
            ctx.fillStyle = "white";
          }
          ctx.fillRect(
            byteRow * blockSize,
            byteCell * blockSize,
            blockSize,
            blockSize
          );
        }
      }
    }
  }
}

function drawRandomBytes(canvas, QRBytes, big) {

  const pixelSize = parseFloat($("#quality").val());
  const blockSize = parseFloat($("#block-size").val()) * pixelSize;

  var ctx = canvas.getContext("2d");
  var tempCanvas = document.createElement("canvas");
  var tempCtx = tempCanvas.getContext("2d");

  tempCanvas.width = canvas.width;
  tempCanvas.height = canvas.height;
  tempCtx.drawImage(canvas, 0, 0, tempCanvas.width, tempCanvas.height);


  if (big) {
    for (var byteRow = 0; byteRow < QRBytes.length; byteRow++) {
      for (var byteCell = 0; byteCell < QRBytes[byteRow].length; byteCell++) {
        if (QRBytes[byteRow][byteCell] !== null) {
          if (QRBytes[byteRow][byteCell] === true) {
            ctx.fillStyle = "black";
          } else {
            ctx.fillStyle = "white";
          }
          ctx.fillRect(
            byteRow * blockSize,
            byteCell * blockSize,
            blockSize,
            blockSize
          );
        }
      }
    }
  } else {
    for (var byteRow = 0; byteRow < QRBytes.length; byteRow++) {
      for (var byteCell = 0; byteCell < QRBytes[byteRow].length; byteCell++) {
        ctx.fillStyle = "black";
        for (var subRow = 0; subRow < 3; subRow++) {
          for (var subCell = 0; subCell < 3; subCell++) {
            ctx.fillStyle = "black";
            if (Math.random() < 0.5) {
              ctx.fillStyle = "white";
            }
            ctx.fillRect(
              byteRow * blockSize + subRow * pixelSize,
              byteCell * blockSize + subCell * pixelSize,
              pixelSize,
              pixelSize
            );
          }
        }
      }
    }
  }
  ctx.drawImage(tempCanvas, 0, 0, canvas.width, canvas.height);
}

function dither(canvas) {
  var ctx = canvas.getContext("2d");
  const pixelSize = parseFloat($("#quality").val());
  const dither = parseInt($("#dither").val());

  var pixels = ctx.getImageData(0, 0, canvas.width, canvas.height);
  var d = pixels.data;
  var width = Math.sqrt(d.length / 4) / pixelSize;

  for (var i = 0; i < d.length; i += 4) {
    var grey = d[i];
    var v = grey >= dither ? 255 : 0;

    // Dithering
    var error = (grey - v) / 8;
    var i2 = i / 4;
    var row = Math.floor(i2 / width);
    var cell = i2 % width;

    d[i] = d[i + 1] = d[i + 2] = v;

    d[((row + 0) * width + (cell + 1)) * 4] = d[
      ((row + 0) * width + (cell + 1)) * 4 + 1
    ] = d[((row + 0) * width + (cell + 1)) * 4 + 2] =
      d[((row + 0) * width + (cell + 1)) * 4] + error;
    d[((row + 0) * width + (cell + 2)) * 4] = d[
      ((row + 0) * width + (cell + 2)) * 4 + 1
    ] = d[((row + 0) * width + (cell + 2)) * 4 + 2] =
      d[((row + 0) * width + (cell + 2)) * 4] + error;
    d[((row + 1) * width + (cell - 1)) * 4] = d[
      ((row + 1) * width + (cell - 1)) * 4 + 1
    ] = d[((row + 1) * width + (cell - 1)) * 4 + 2] =
      d[((row + 1) * width + (cell - 1)) * 4] + error;
    d[((row + 1) * width + (cell + 0)) * 4] = d[
      ((row + 1) * width + (cell + 0)) * 4 + 1
    ] = d[((row + 1) * width + (cell + 0)) * 4 + 2] =
      d[((row + 1) * width + (cell + 0)) * 4] + error;
    d[((row + 1) * width + (cell + 1)) * 4] = d[
      ((row + 1) * width + (cell + 1)) * 4 + 1
    ] = d[((row + 1) * width + (cell + 1)) * 4 + 2] =
      d[((row + 1) * width + (cell + 1)) * 4] + error;
    d[((row + 2) * width + (cell + 0)) * 4] = d[
      ((row + 2) * width + (cell + 0)) * 4 + 1
    ] = d[((row + 2) * width + (cell + 0)) * 4 + 2] =
      d[((row + 2) * width + (cell + 0)) * 4] + error;
  }
  ctx.putImageData(pixels, 0, 0);
}

function pixelate(canvas) {
  const pixelation = parseFloat($("#pixelation").val());
  const ctx = canvas.getContext("2d");
  const { width, height } = canvas;

  var tempCanvas = document.createElement("canvas");
  var tempCtx = tempCanvas.getContext("2d");

  // const tempCanvas = document.createElement("canvas");
  const scaledWidth = width * (1 - pixelation / 100);
  const scaledHeight = height * (1 - pixelation / 100);
  // const tempCtx = tempCanvas.getContext("2d");
  console.log(scaledWidth, scaledHeight)

  tempCanvas.width = scaledWidth;
  tempCanvas.height = scaledHeight;

  tempCtx.webkitImageSmoothingEnabled = false;
  tempCtx.mozImageSmoothingEnabled = false;
  tempCtx.msImageSmoothingEnabled = false;
  tempCtx.imageSmoothingEnabled = false;

  ctx.webkitImageSmoothingEnabled = false;
  ctx.mozImageSmoothingEnabled = false;
  ctx.msImageSmoothingEnabled = false;
  ctx.imageSmoothingEnabled = false;

  tempCtx.drawImage(canvas, 0, 0, scaledWidth, scaledHeight);
  ctx.clearRect(0, 0, canvas.width, canvas.height);
  ctx.drawImage(tempCanvas, 0, 0, width, height);

  // ctx.drawImage(canvas, 0, 0, canvas.width / 2, canvas.height / 2);
}
function constrast(canvas) {
  const contrast = parseFloat($("#contrast").val());
  var ctx = canvas.getContext("2d");

  var pixels = ctx.getImageData(0, 0, canvas.width, canvas.height);
  var d = pixels.data;
  for (var i = 0; i < d.length; i += 4) {
    var r = d[i];
    var g = d[i + 1];
    var b = d[i + 2];
    if ((r + b + g) / 3 > contrast) {
      d[i] = d[i + 1] = d[i + 2] = 255;
    } else {
      d[i] = d[i + 1] = d[i + 2] = 0;
    }
    // var grey = r * 0.2126 + g * 0.7152 + b * 0.0722;
    // //var v = (grey >= 127) ? 255 : 0;
    // //d[i] = d[i+1] = d[i+2] = v;
    // d[i] = d[i + 1] = d[i + 2] = grey;
  }
  ctx.putImageData(pixels, 0, 0);
}
function greyscale(canvas) {
  const greyscale = parseFloat($("#greyscale").val());
  var ctx = canvas.getContext("2d");
  canvas.style.filter = `grayscale(${greyscale}%)`;
}
