  function updateCroppie(image) {
    if (croppie) {
      croppie.destroy();
    }
    let smallestSize = image.height < image.width ? image.height : image.width;
    if (smallestSize >= crop.offsetWidth * 0.9) {
      smallestSize = crop.offsetWidth * 0.9;
    }
    croppie = new Croppie(crop, {
      url: image.src,
      enforceBoundary: false,
      viewport: { width: smallestSize, height: smallestSize },
      boundary: { width: smallestSize * 1.2, height: smallestSize * 1.2 },
    });
    window.croppie = croppie; //for testing
    setTimeout(() => {
      croppie.setZoom(1);
    }, 10);
  }
